{
    HMClaimSchema                   hmClaimSchemaLocal;
    HMClaimTemplate                 hmClaimTemplateLocal;
    HMClaimTemplateFieldSchema      hmClaimTemplateLocalFieldSchema,hmClaimTemplateLocalFieldSchemaForUpdate;
    FieldName                       fieldname;
    RecId                           claimTemplateRecId;
    HMCreateTable hmCreateTable;
    DictField                       dictField;
    claimTemplateRecId = HMClaimTemplateFieldSchema::find(claimTemplateFieldSchemaRecId).HMClaimTemplate;

    while select * from hmClaimTemplateLocalFieldSchema
        join * from hmClaimTemplateLocal
        join * from hmClaimSchemaLocal
        where hmClaimTemplateLocalFieldSchema.HMClaimTemplate == hmClaimTemplateLocal.RecId
        && hmClaimTemplateLocalFieldSchema.HMClaimSchema == hmClaimSchemaLocal.RecId
        && hmClaimTemplateLocalFieldSchema.HMClaimTemplate == claimTemplateRecId
        && hmClaimTemplateLocalFieldSchema.HMClaimTemplateField != 0
    {
        hmCreateTable = new hmCreateTable(hmClaimTemplateLocal.TableName);
        fieldname = '';
        fieldname = enum2str(hmClaimSchemaLocal.Entity);
        fieldname += this.removeSpecialCharacter(hmClaimSchemaLocal.DisplayName);

        if(hmClaimSchemaLocal.IsMethod == NoYes::No)
        {
            dictField = new DictField(hmClaimSchemaLocal.RefTableId,str2int(hmClaimSchemaLocal.Field));
            hmCreateTable.addNewField(fieldname,dictField);
        }
        else
        {
            hmCreateTable.addNewField(fieldname);
        }

        ttsBegin;
        hmClaimTemplateLocalFieldSchemaForUpdate = HMClaimTemplateFieldSchema::find(hmClaimTemplateLocalFieldSchema.RecId,true);
        hmClaimTemplateLocalFieldSchemaForUpdate.ClaimTemplateFieldName = fieldname;
        hmClaimTemplateLocalFieldSchemaForUpdate.update();
        ttsCommit;

    }
}

